package com.rongke.model;import com.fasterxml.jackson.annotation.JsonFormat;import com.fasterxml.jackson.databind.annotation.JsonDeserialize;import com.fasterxml.jackson.databind.annotation.JsonSerialize;import com.rongke.utils.DateJsonDeserializer;import com.rongke.utils.DateJsonSerializer;import org.springframework.format.annotation.DateTimeFormat;import com.baomidou.mybatisplus.annotations.TableField;import com.baomidou.mybatisplus.annotations.TableId;import com.baomidou.mybatisplus.annotations.TableName;import com.baomidou.mybatisplus.enums.IdType;import java.io.Serializable;/** * @Address * @地址(address) * @version : Ver 1.0 */@TableName("address")public class Address implements Serializable {	@TableField(exist = false)	private static final long serialVersionUID = 1L;	/**	 * @备注:	 * @字段:id BIGINT(19)	 */	@TableId(type = IdType.AUTO)	@JsonFormat(shape = JsonFormat.Shape.STRING)	private java.lang.Long id;	@JsonFormat(shape = JsonFormat.Shape.STRING)	private java.lang.Long userId;	/**	 * @备注:省	 * @字段:province VARCHAR(45)	 */	private java.lang.String province;	/**	 * @备注:市	 * @字段:city VARCHAR(45)	 */	private java.lang.String city;	/**	 * @备注:区	 * @字段:area VARCHAR(45)	 */	private java.lang.String area;	/**	 * @备注:详细地址	 * @字段:address_detail VARCHAR(45)	 */	private java.lang.String addressDetail;	/**	 * @备注:状态	 * @字段:status VARCHAR(45)	 */	private java.lang.String status;	/**	 * @备注:	 * @字段:gmt_datetime DATETIME(19)	 */	@JsonSerialize(using=DateJsonSerializer.class)	@JsonDeserialize(using=DateJsonDeserializer.class)	@DateTimeFormat(pattern = "yyyy-MM-dd HH:mm:ss" )	private java.util.Date gmtDatetime;	/**	 * @备注:	 * @字段:upt_datetime DATETIME(19)	 */	@JsonSerialize(using=DateJsonSerializer.class)	@JsonDeserialize(using=DateJsonDeserializer.class)	@DateTimeFormat(pattern = "yyyy-MM-dd HH:mm:ss" )	private java.util.Date uptDatetime ;	public Address(){	}	public Address(		java.lang.Long id	){		this.id = id;	}	public void setId(java.lang.Long id) {		this.id = id;	}	public java.lang.Long getId() {		return this.id;	}	public void setProvince(java.lang.String province) {		this.province = province;	}	public java.lang.String getProvince() {		return this.province;	}	public void setCity(java.lang.String city) {		this.city = city;	}	public java.lang.String getCity() {		return this.city;	}	public void setArea(java.lang.String area) {		this.area = area;	}	public java.lang.String getArea() {		return this.area;	}	public void setAddressDetail(java.lang.String addressDetail) {		this.addressDetail = addressDetail;	}	public java.lang.String getAddressDetail() {		return this.addressDetail;	}	public void setStatus(java.lang.String status) {		this.status = status;	}	public java.lang.String getStatus() {		return this.status;	}	public void setGmtDatetime(java.util.Date gmtDatetime) {		this.gmtDatetime = gmtDatetime;	}	public java.util.Date getGmtDatetime() {		return this.gmtDatetime;	}	public Long getUserId() {		return userId;	}	public void setUserId(Long userId) {		this.userId = userId;	}	public void setUptDatetime(java.util.Date uptDatetime) {		this.uptDatetime = uptDatetime;	}	public java.util.Date getUptDatetime() {		return this.uptDatetime;	}}